Build the package locally with the following command: Set the flake variable if you are working on a clone or leave it as it is to use the github repository directly. SYSTEM=${SYSTEM:-"x86_64-linux"}
FLAKE=${FLAKE:-"github:cardano-foundation/cardano-deposit-wallet"}
VERSION=$(nix eval --raw $FLAKE#version)
export WALLET_PACKAGE="result/cardano-deposit-wallet-$VERSION-$PACKAGED_FOR.tar.gz"
nix build $FLAKE#$PACKAGED_FOR.package
